import React from 'react';
import Record from './Record';


function Collection ({records, removeRecord}){

  removeRecord()
  return(
    <div>
      {records.map((record, index, removeRecord) => (
        <Record 
          key={index}
          artist={record.artist}
          title={record.title}
          year={record.year}
          label={record.label}
          removeRecord={removeRecord}
        />
      ))}
    </div>
  )
}
export default Collection;
